(6,1,"2021-04-16 17:39:46","2021-04-16 17:39:46","[rev_slider alias=\"slider-1\" slidertitle=\"Slider 1\"][/rev_slider][services_home]		\n			<a href=\"https://www.lorraine-nord-sante.fr/services//\" role=\"button\">\n						TOUS NOS TÉLÉSERVICES\n					</a>\n			<h2>Le e-santé à portée de tous</h2>		\n		<p>Notre plateforme s’adresse aux professionnels de santé afin d’assurer le suivi médical de<br />leur patientèle, ainsi qu’aux patients pour un parcours de santé en toute transparence.</p>		\n			<h2>VOUS ÊTES UN\nPATIENT</h2>		\n		<p>Découvrez les téléservices Sillons<br />adaptés à votre situation &gt;</p>		\n			<a href=\"#\" role=\"button\">\n						ACCÈS ESPACE PATIENTS\n					</a>\n			<h2>VOUS ÊTES UN\nPROFESSIONNEL DE SANTÉ</h2>		\n		<p>Découvrez les outils Sillons<br />mis à votre disposition &gt;</p>		\n			<a href=\"#\" role=\"button\">\n						ACCÈS ESPACE PROFESSIONNELS\n					</a>\n										<img width=\"849\" height=\"486\" src=\"http://sillonsdev.local/wp-content/uploads/2021/04/publics.png\" alt=\"\" loading=\"lazy\" srcset=\"http://sillonsdev.local/wp-content/uploads/2021/04/publics.png 849w, http://sillonsdev.local/wp-content/uploads/2021/04/publics-300x172.png 300w, http://sillonsdev.local/wp-content/uploads/2021/04/publics-768x440.png 768w\" sizes=\"(max-width: 849px) 100vw, 849px\" />											\n			<h2>Et si on vous <br> facilitait la santé ?</h2>		\n		Pensés conjointement avec des patients et des professionnels de santé, les services de la plateforme SILLONS vous permettent de gérer votre santé en ligne.		\n			<a href=\"https://www.lorraine-nord-sante.fr/presentation/projet//\" role=\"button\">\n						EN SAVOIR PLUS SUR LE PROJET\n					</a>\n		https://www.youtube.com/watch?v=XHOmBV4js_E		\n			<h2>Toute notre actualité</h2>		\n		<p>Retrouvez les dernières publications de nos réseaux sociaux sur<br />le projet SILLONS et les acteurs du groupement.</p>[social-wall]\n    [custom-facebook-feed type=\"timeline\" account=\"830353830354572\"]\n[/social-wall]\n			<h2>Besoin <br> d\'information ?</h2>		\n		<p>Vous souhaitez obtenir plus de<br />renseignements sur SILLONS et ses<br />téléservices ?</p>		\n			<a href=\"https://www.lorraine-nord-sante.fr/contact//\" role=\"button\">\n						NOUS CONTACTER\n					</a>\n			<h2>Foire aux <br> questions</h2>		\n		<p>Consultez notre FAQ ainsi que notre<br />lexique sur les différents termes<br />médicaux liés à nos téléservices.</p>		\n			<a href=\"https://www.lorraine-nord-sante.fr/faq//\" role=\"button\">\n						LIRE LA FAQ\n					</a>\n		[logoshowcase dots=\"false\" center_mode=\"true\" slides_column=\"4\"]","Home","","publish","closed","closed","","home","","","2021-05-18 08:06:48","2021-05-18 08:06:48","",0,"http://sillonsdev.local/?page_id=6",0,"page","",0),
