</strong><br />XXXX XXXXXXX<br />XXXXX XXXXXXX</p><p><strong>Politique d’utilisation des cookies</strong><br /><strong>Qu’est-ce qu’un cookie ?</strong></p><p>Un cookie est un fichier stocké par votre navigateur lors de votre première visite sur une période donnée. Il nous permet de vous reconnaître à chaque visite, et donc de vous faire profiter de toutes les fonctionnalités de notre site, en mémorisant vos actions et préférences. Nous utilisons Google Tag Manager dans la mise en place des cookies.</p><p><strong>Qu’est-ce qu’un cookie ?</strong></p><p>Mesure d’audience : permet de quantifier la fréquentation d’un site en fonction d’indicateurs tels que le nombre de visiteurs uniques, les pages vues, les visites, la durée moyenne des visites. L’analyse du trafic de notre site nous permet d’améliorer ses fonctionnalités afin de vous offrir un service de qualité. Les cookies nous transmettent un retour d’expérience anonyme de votre utilisation de notre site internet. La finalité unique de ces cookies est d’améliorer notre site en facilitant votre expérience utilisateur. Les informations ainsi collectées n’ont pas pour but de vous identifier.</p><p><strong>Comment refuser un Cookie par l’intermédiaire de votre logiciel de navigation ?</strong></p><p>Vous pouvez à tout moment bloquer, contrôler ou supprimer les cookies déjà stockés sur votre ordinateur en configurant les paramètres de votre navigateur internet. Pour savoir comment procéder, consultez les sites en lien ci-dessous en fonction de votre type de navigateur : Firefox, Chrome, Explorer, Safari, Opera.</p><p>Les cookies ne sont pas indispensables à l’utilisation du site, cependant ils vous permettent de faciliter cette expérience. Leur désactivation vous empêchera d’utiliser notre site dans des conditions normales, à l’exception des fonctions basiques. Cela impliquera également la réinitialisation de vos préférences à chaque passage sur notre site.</p><p><strong>Données personnelles</strong></p><p>Nous sommes particulièrement sensibilisés à la règlementation en matière de protection des données. C’est pourquoi nous souhaitons rendre aussi claires et accessibles que possible toutes les informations relatives aux traitements de données effectués sur notre site internet.</p><p>Le but de notre politique de confidentialité est de vous informer sur l’utilisation qui sera faite des données personnelles vous concernant collectées via ce site internet, ainsi que sur vos droits et sur votre pouvoir de les exercer.</p><p>Cette politique est également le reflet de nos principes en matière de confidentialité et de sécurité des données personnelles. Le traitement des données est un enjeu important, c’est pourquoi nous nous devons de nous assurer qu’il soit réalisé en toute sécurité et en conformité avec votre volonté.</p><p>En amont de la transmission de vos données personnelles depuis nos formulaires, vous vous engagez à lire et à accepter notre politique de confidentialité. Ce consentement clair et non équivoque nous permet de répondre à vos demandes grâce aux données transmises dans ce but.</p><p><strong>Engagements</strong></p><p>Nous nous engageons à respecter la législation relative aux données à caractère personnel, ainsi que le Règlement (UE) 2016/679 du Parlement européen et du Conseil du 27 avril 2016, dès son entrée en vigueur le 25 mai 2018.</p><p>Ainsi, nous nous engageons à n’utiliser les données personnelles reçues qu’en conformité avec les finalités propres à leur transmission et à déployer les moyens nécessaires au respect desdits textes, notamment pour veiller à fournir un niveau de sécurité adapté aux finalités du traitement et à la nature de ces données.</p><p>Notre équipe se tient à votre disposition en cas de question relative à cette politique de confidentialité.</p><p><strong>Responsabilité de la collecte</strong></p><p>Pour la collecte de vos données personnelles sur notre site internet, nous agissons en tant que responsable de traitement et nous collectons directement lesdites données. Notre siège social est situé à l’adresse suivante :</p><p><strong>Destination Amnéville</strong><br />2 rue de l’Europe<br />57360 Amnéville</p><p><strong>Finalité du traitement des données personnelles collectées</strong></p><p><strong>Les données personnelles</strong> recueillies sur le site résultent de la communication volontaire d\'une adresse de courrier électronique lors de l\'envoi d\'un formulaire. Les adresses E-mail ainsi recueillies ne servent qu’à transmettre les éléments d’information demandés.<br /><strong>Les adresses électroniques collectées ne feront</strong> l’objet d’aucune cession à des tiers ni d’aucun traitement de la part du responsable éditorial.<br /><strong>La loi \"Informatique et Libertés\" du 6 janvier 1978</strong> modifiée par la loi du 6 août 2004 encadre la mise en oeuvre des fichiers ou des traitements de données à caractère personnel qu\'ils soient automatisés ou manuels. Vous disposez d\'un droit d\'accès, de modification, de rectification et de suppression des données qui vous concernent (art. 34 de la loi \"Informatique et Libertés\"). Vous pouvez l\'exercer par mail en le précisant dans le formulaire suivant : Contact / E-Mail.</p><p><strong>Combien de temps vos données sont-elles stockées ?</strong></p><p>Toutes les données collectées au sein de nos espaces de contact ne sont conservées que le temps nécessaire à la réalisation de leur(s) finalité(s) tant que vous ne retirerez pas votre consentement lié à la transmission de ces données.</p><p>Les données transmises via nos formulaires seront soit supprimées immédiatement, dans le cas où aucune suite ne pourrait être donnée à votre prise de contact, soit conservées le temps de notre collaboration et ce jusqu’à 5 à 10 ans après son terme.</p><p><strong>Qui peut accéder à vos données ?</strong></p><p>Seules les personnes compétentes et indispensables au bon traitement de vos données peuvent y accéder.</p><p>Nous nous engageons à ne jamais vendre vos données. Toute communication de vos données à un tiers ne se fera qu’avec votre consentement, pour faciliter votre expérience sur notre site internet ou dans le cadre de la mise en œuvre d’un contrat préalablement signé par vous.</p><p><strong>Comment exercer vos droits ?</strong></p><p>Lorsque vous acceptez de nous transmettre vos données vous bénéficiez d’un droit d’accès, de rectification, d’opposition et de suppression au traitement desdites données. En application du règlement 2016/679 du 27 avril 2016, vous pourrez exercer vos droits à la limitation du traitement, à l’effacement de vos données et leur portabilité à partir du 25 mai 2018.</p><p>Ces droits peuvent être exercés en transmettant votre demande via notre formulaire de contact ou par courrier postal à Destination Amnéville, 2 rue de l’Europe, 57360 Amnéville. Nous nous engageons à faire le nécessaire dans les meilleurs délais après réception de votre demande et vous transmettre le cas échéant une notification de son action.</p><p><strong>Modification de cette politique</strong></p><p>Nous nous réservons le droit de modifier et mettre à jour à tout moment notre politique de confidentialité conformément au droit en vigueur.</p>","Mentions Légales","","inherit","closed","closed","","158-revision-v1","","","2021-04-19 11:50:58","2021-04-19 11:50:58","",158,"http://sillonsdev.local/?p=353",0,"revision","",0),
